import React from 'react';
import { NavLink } from 'react-router-dom';

const Home = () => {
  return (
    <div className='homepage'>
      <div className="bannerText uppercase text-center">
        <h1 className='bannerTitle'>I am Hans Hanken and I</h1>
        <p className='bannerSubTitle'>Full stack web developer | kickass websites</p>
      </div>
    </div>
  );
}

export default Home;
